webpackJsonp([35633206587980],{1124:function(t,a){t.exports={data:{nodePost:{title:"Hot JAMStack in React For Drupal Newsletter ",link:null,body:{value:'<blockquote>\r\n<p>I\'ve always found that one of the best ways to learn something new is to get my hands dirty and start writing code. But it also helps me to have a project to work on, and a goal in mind. You could always go the traditional route and build a to-do list. I need something that\'s going to hold my attention a bit longer though. With that in mind, here are a couple of ideas that have inspired me recently.</p>\r\n\r\n<p><a href="https://events.drupal.org/nashville2018/sessions/hot-jamstack-building-music-discovery-app-drupal-and-react">Hot JAMS(tack): Building a Music Discovery App with Drupal and React</a><br />\r\nBrian Perry gave a talk at DrupalCon Nashville about how he created an application for visualizing trends in popular music using Drupal and React. It\'s an interesting example, and I love how he\'s taken something he\'s passionate about and turned it into a learning opportunity. Find something to play with in <a href="https://github.com/toddmotto/public-apis">this huge list of publicly available APIs</a>.</p>\r\n</blockquote>\r\n\r\n<p>Thanks to <a href="https://www.drupal.org/u/eojthebrave">Joe Shindelar</a> and the folks at <a href="http://lullaboteducation.com/">Lullabot Education</a> for the nice shout out in the <a href="https://reactfordrupal.com/">React for Drupal</a> newsletter. Here\'s to hoping this project continues to be useful for people.</p>'},relationships:{image:null},created:1529519105}},pathContext:{slug:"/note/hot-jamstack-in-react-for-drupal-newsletter/"}}}});
